import { createApp } from 'vue'
import App from './App.vue'
import router from './router'
import getMqttClient from "@/composables/getMqttClient";

const app = createApp(App)
const mqttClient = getMqttClient();

app.use(router)
app.use(mqttClient)
app.mount('#app')
